Letterer:  Comicraft
Cover Artist:  Adam Hughes

Wonder Woman (1987-2006) #164
&quot;Gods of Gotham&quot; part 1! Wonder Woman travels to Gotham to help Batman defeat the Joker, Scarecrow and Poison Ivy--only they're possessed by even more sinister forces.

Wonder Woman (1987-2006) #165
Wonder Woman and Batman have been drawn into their enemies' trap, unaware of the true power they were confronting. Now the Amazon Princess and Dark Knight Detective find themselves overwhelmed by the awesome power they face! &quot;Gods of Gotham&quot; part 2.

Wonder Woman (1987-2006) #166
Wonder Woman's mission to rescue Gotham City from the God of War's evil offspring has turned into the greatest challenge of her life--even with Batman, Nightwing and Troia by her side. &quot;Gods of Gotham&quot; part 3.

Wonder Woman (1987-2006) #167
As if Deimos, Phoebos and Eris weren't dangerous enough in the bodies of the Joker, Scarecrow and Poison Ivy, the situation turns critical as Phoebos picks a new host-body. &quot;Gods of Gotham&quot; part 4.

Wonder Woman (1987-2006) #168
&quot;Paradise Island Lost&quot; part 1! There's trouble in Paradise. The two tribes of Amazons that live on Themyscira have their allegiance tested as their differences come to a head and a civil war looms on the horizon.

Wonder Woman (1987-2006) #169
It's a major turning point for the people of Paradise Island as the civil war reaches its climax but not without one heavy casualty. Plus the Golden Age Fury unleashes her wrath on Wonder Woman. &quot;Paradise Island Lost&quot; part 2.

